export function TransitionRoleBadge() {
  const [progress, setProgress] = useState({
    isActive: true,
    error: null,
  });

  const [role, setRole] = useState(null);

  return (
    <Router>
      <button
        onClick={() => {
          setProgress({ isActive: false, error: null });
          setRole({
            '@id': 'role:e0a86b93-c127-4a3a-8399-dda0e60a30ef',
            '@type': 'PublicReviewerRole',
            name: 'Peter Jon Smith',
            startDate: '2019-10-17T14:30:13.097Z',
            modifiedDate: '2019-10-17T14:30:13.744Z',
            avatar: {
              '@type': 'ImageObject',
              encodingFormat: 'image/jpeg',
              contentUrl: avatarUrl,
            },
          });
        }}
      >
        Complete fetch
      </button>

      <button
        onClick={() => {
          setProgress({ isActive: true, error: null });
          setRole(null);
        }}
      >
        restart fetch
      </button>

      <RoleBadgeUI
        roleId="role:e0a86b93-c127-4a3a-8399-dda0e60a30ef"
        role={role}
        fetchRoleProgress={progress}
      />
    </Router>
  );
}

var avatarUrl =
  'data:image/jpeg;base64,';
